Fetching last 30 days of Mongo records, summing by date, and filling in missing dates in range<p>I have a Mongo database filled with &quot;Events&quot; records, that look like this:</p>
<pre><code>{
    timestamp: 2022-03-15T22:11:34.711Z,
    _id: new ObjectId(&quot;62310f16b0d71321e887a905&quot;)
}
</code></pre>
<p>Using a NodeJs server, I need to fetch the last 30 days of Events, grouped/summed by date, and any dates within that 30 days with no records need to be filled with 0.</p>
<p>Using this code I can get the correct events, grouped/summed by date:</p>
<pre><code>Event.aggregate( [
      { 
          $match:  {   
              timestamp: {
                  $gte: start,
                 $lte: end,
             }
        } 
    },
    {
        $project: {
            date: {
               $dateToParts: { date: &quot;$timestamp&quot; }
            },
         }
      },
      {
         $group: {
            _id: {
               date: {
                  year: &quot;$date.year&quot;,
                  month: &quot;$date.month&quot;,
                  day: &quot;$date.day&quot;
               }
            },
            &quot;count&quot;: { &quot;$sum&quot;: 1 }
         }
    }
] )
</code></pre>
<p>This will return something like this:</p>
<pre><code>[
    {
        &quot;_id&quot;: {
            &quot;date&quot;: {
                &quot;year&quot;: 2022,
                &quot;month&quot;: 3,
                &quot;day&quot;: 14
            }
        },
        &quot;count&quot;: 3
    },
    {
        &quot;_id&quot;: {
            &quot;date&quot;: {
                &quot;year&quot;: 2022,
                &quot;month&quot;: 3,
                &quot;day&quot;: 15
            }
        },
        &quot;count&quot;: 8
    },
]
</code></pre>
<p>I also have this Javascript code to generate the last 30 days of dates:</p>
<pre><code> const getDateRange = (start, end)  =&gt; {
    const arr = [];
    for(let dt = new Date(start); dt &lt;= end; dt.setDate(dt.getDate() + 1)){
        arr.push(new Date(dt));
    }
    return arr;
};
const subtractDays = (date, days) =&gt; {
    return new Date(date.getTime() - (days * 24 * 60 * 60 * 1000));
}

const end = new Date(); 
const start = subtractDays(end, 30);
const range = getDateRange(start, end);
</code></pre>
<p>Which returns something like this:</p>
<pre><code>[
  2022-03-09T01:13:10.769Z,
  2022-03-10T01:13:10.769Z,
  2022-03-11T01:13:10.769Z,
  2022-03-12T01:13:10.769Z,
  2022-03-13T01:13:10.769Z,
  ...
]
</code></pre>
<p>It seems like I have all the pieces, but I'm having trouble putting all this together to do what I need in an efficient way. Any push in the right direction would be appreciated.</p>

