MongoDB - Aggregate get specific objects in an array<p>How can I get only objects in the <code>sales</code> array matching with <strong>2021-10-14</strong> date ?<br/>
My aggregate query currently returns all objects of the sales array if at least one is matching.</p>
<p><strong>Dataset Documents</strong></p>
<pre><code>{
    &quot;name&quot;: &quot;#0&quot;,
    &quot;sales&quot;: [{
        &quot;date&quot;: &quot;2021-10-14&quot;,
        &quot;price&quot;: 3.69,
    },{
        &quot;date&quot;: &quot;2021-10-15&quot;,
        &quot;price&quot;: 2.79,
    }]
},
{
    &quot;name&quot;: &quot;#1&quot;,
    &quot;sales&quot;: [{
        &quot;date&quot;: &quot;2021-10-14&quot;,
        &quot;price&quot;: 1.5,
    }]
}
</code></pre>
<p><strong>Aggregate</strong></p>
<pre><code>{
  $match: {
    sales: {
      $elemMatch: {
        date: '2021-10-14',
      },
    },
  },
},
{
  $group: {
    _id: 0,
    data: {
      $push: '$sales',
    },
  },
},
{
  $project: {
    data: {
      $reduce: {
        input: '$data',
        initialValue: [],
        in: {
          $setUnion: ['$$value', '$$this'],
        },
      },
    },
  },
}
</code></pre>
<p><strong>Result</strong></p>
<pre><code>{&quot;date&quot;: &quot;2021-10-14&quot;,&quot;price&quot;: 3.69},
{&quot;date&quot;: &quot;2021-10-15&quot;,&quot;price&quot;: 2.79},
{&quot;date&quot;: &quot;2021-10-14&quot;,&quot;price&quot;: 1.5}
</code></pre>
<p><strong>Result Expected</strong></p>
<pre><code>{&quot;date&quot;: &quot;2021-10-14&quot;,&quot;price&quot;: 3.69},
{&quot;date&quot;: &quot;2021-10-14&quot;,&quot;price&quot;: 1.5}
</code></pre>

